\section*{Mentoring Plan}




The PI's mentoring approach emphasizes the holistic development of graduate students as both researchers and professionals, aiming to cultivate not only their technical skills in HCI but also their abilities to generate broader impact based on their research. This plan will help students navigate their academic journey and prepare them for diverse career paths in academia, industry, or beyond.




\subsubsection*{Career Counseling}

The PI will provide tailored career counseling through quarterly one-on-one meetings (in addition to regular weekly meetings), encouraging students to reflect on their career plan and discuss recent opportunities and notable success examples. The PI will actively help students set short- and long-term career goals, connect them with relevant professionals in their field, and guide them through processes such as networking, internship applications, job talk, and interviews. The PI will also support students in attending workshops related to their research interest and top conferences where they can build connections and disseminate their work.




\subsubsection*{Training in Preparation of Proposals, Publications, and Presentations}

Students will receive training in writing research articles, conference presentations, and grant proposals. 

The PI will provide detailed feedback on manuscript drafts and encourage students to publish their work in high-impact conferences and journals. The PI will also help students develop effective communication skills by encouraging them to present their research at group meetings, workshops, and conferences and providing guidance on creating clear and engaging slides, posters, and narratives.

Further, the PI will mentor students, perhaps at a more senior stage of their PhD program, in the complete process of preparing competitive research proposals by reviewing drafts, discussing funding opportunities, and offering insight into structuring a compelling proposal.




\subsubsection*{Improvement of Teaching and Mentoring Skills}

The PI will provide opportunities for graduate students to improve their teaching and mentoring abilities. For those interested in teaching, the PI will encourage participation in teaching assistantships and provide constructive feedback on their performance. The PI will also share best practices in pedagogy, including active learning strategies and student engagement techniques. In terms of mentoring, The PI will provide opportunities for senior graduate students to mentor undergraduates or newer graduate students in the lab, fostering a collaborative and supportive environment. The PI will provide resources and advice on how to be an effective mentor and how to foster positive mentor-mentee relationships.




\subsubsection*{Collaboration with Researchers from Diverse Backgrounds and Disciplines}

The PI will encourage interdisciplinary collaboration and the integration of diverse methods in research. Students will have opportunities to collaborate with researchers from various fields, both within the institution and through external partnerships. The PI will guide students on how to communicate effectively across disciplinary boundaries and how to leverage collaborators' expertise to strengthen a project. 




\subsubsection*{Training in Responsible Professional Practices}

Ethical and responsible professional conduct is a cornerstone of this mentoring plan. The PI will provide training on responsible research practices, including research integrity, data management, and ethical considerations related to human subjects. The PI will also emphasize the importance of inclusivity and equity, ensuring that students are aware of their responsibilities as professionals. Discussions on issues such as authorship, conflicts of interest, and peer review will be integrated into regular one-on-one meetings.




By supporting students in these above areas, the PI aims to prepare them to be well-rounded professionals who are capable of excelling in diverse roles and contributing positively to the HCI fields.
